/** @format */

import React from "react";
import styled from "styled-components";
import { Button } from "antd";
const FisrtBlock = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin: 0 auto;
  max-width: 768px;
  height: 100vh;
  padding: 60px 30px;
`;

const ButtonBlock = styled(Button)`
  background-color: #42a5f5;
  color: white;
  &:hover {
    background-color: hsl(
      137.9381443298969,
      62.58064516129033%,
      30.3921568627451%
    );
    color: white;
  }
  margin-top: ${(props) => props.margin};
  background: ${(props) => props.background};
`;

const First = () => {
  return (
    <>
      <FisrtBlock>
        <ButtonBlock>일반 로그인</ButtonBlock>
        <ButtonBlock
          background="hsl(137.9381443298969, 62.58064516129033%, 30.3921568627451%)"
          margin="30px"
        >
          사장님 로그인
        </ButtonBlock>
      </FisrtBlock>
    </>
  );
};

export default First;
